import { FaUserCircle } from 'react-icons/fa';

const Nav = () => {
  return (
    <nav className="bg-gray-600 p-4 flex justify-between items-center">
      <div className="flex items-center">
        <h1 className="text-white text-2xl font-bold">My App</h1>
      </div>
      <div className="flex items-center">
        <a href="/" className="text-white mr-4">
          Home
        </a>
        <a href="/about" className="text-white mr-4">
          About
        </a>
        <a href="/contact" className="text-white mr-4">
          Contact
        </a>
        <div className="relative">
          <FaUserCircle className="text-white cursor-pointer" size={24} />
          {/* You can use an image or other profile indicator if needed */}
        </div>
      </div>
    </nav>
  );
};

export { Nav};
